import { Form, Button, Card } from "antd";
const FormItem = Form.Item;
const { Meta } = Card;
import React, { useState } from "react";
import Navbar from "./components/component.navbar";
import CardProduct from './components/component.cardproduct'
import Header from './components/component.header'
import { useSelector,useDispatch } from "react-redux";
import { updateTypeBland } from "../store/actions/postAction";


function ShopPage() {
  const dispatch = useDispatch();
  const [nameproduct , setNameproduct] = useState('ACER')
  const { TypeBland } = useSelector(
    (state) => state.post
  );

  return (
    <FormItem style={{ margin: "0px" }}>
      <div className="sp">
        <div className="br-header">
          <Header />
        </div>
        <div className="br-body">
          <div className="sp-body-1">
            <Navbar page={"shop"} />
          </div>
          <div className="sp-body-2">
            <div className="sp-body-2-header">
              <h1 style={{color:"black",fontSize:"40px"}}>{TypeBland}</h1>
            </div>
            <div className="sp-body-2-body">
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
              <CardProduct />
            </div>
          </div>
        </div>
      </div>
    </FormItem>
  );
}

export default ShopPage;
